import MainHeader from "../components/MainHeader";
import UnleashCreativityContainer from "../components/UnleashCreativityContainer";
import PopularDesignsContainer from "../components/PopularDesignsContainer";
import AITrainersContainer from "../components/AITrainersContainer";
import PromptIdeasContainer from "../components/PromptIdeasContainer";
import SubscribeForm from "../components/SubscribeForm";
import styles from "./FitnessLandingPage.module.css";

const FitnessLandingPage = () => {
  return (
    <div className={styles.fitnesslandingpage}>
      <MainHeader />
      <UnleashCreativityContainer />
      <PopularDesignsContainer />
      <AITrainersContainer />
      <PromptIdeasContainer />
      <SubscribeForm />
    </div>
  );
};

export default FitnessLandingPage;
